              <div class="login-form" id="loginForm">
                <h1>                     
                    <img src="{{asset('/images/logo.png')}}" alt="logo-large" class="logo-lg logo-light">
                </h1>
                <div class="form-guarderia">
                  <p>Sử dụng <strong>Email và mật khẩu</strong> hoặc đăng nhập bằng <strong>Tài khoản Google do nhà trường cấp</strong></p>
                  <label>Email</label>
                  <input id="email" type="email" required />
                  <label>Mật khẩu</label>
                  <input id="password" type="password" required />
                  <button onclick="login()">Đăng nhập</button>
                  <center>
                    <label>hoặc</label>
                    <button onclick="location.href='{{route('googlelogin')}}'"><i class="fa-brands fa-google"></i> Tiếp tục với Google </button>
