            <script src="{{asset('js/notiflix-aio.js')}}"></script>

            @if(isset($msg))
              <script>
                  Notiflix.Notify.failure('Chỉ đăng nhập bằng tài khoản thuộc hệ thống fpt.edu.vn');
              </script>
            @endif
            <script>
                const login = () =>{
                    let email = $('#email').val();
                    let password = $('#password').val();
                    let success = true;
                    if(email == null || email == ''){
                        success = false;
                        Notiflix.Notify.failure('Email không được để trống');
                    }
                    if(password == null || password == ''){
                        success = false;
                        Notiflix.Notify.failure('Password không được để trống');
                    }
                    if(success == true){
                        $.ajaxSetup({
                            headers: {
                                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                            }
                        });
                        Notiflix.Block.pulse('#loginForm');
                        $.ajax({
                            url: "/api/auth/login",
                            dataType: "json",
                            type: 'POST',
                            data: {
                                email: email,
                                password: password
                            }
                        }).done(function(res){
                            Notiflix.Block.remove('#loginForm');
                            if(res.success==true){
                                Notiflix.Notify.success(res.msg)
                                setTimeout(function(){
                                    window.location.reload();
                                }, 3000)
                            }else{
                                Notiflix.Notify.failure(res.msg)
                            }
                        })
                    }
                }
            </script>
